import React from 'react';


function App() {
  return (
    <section>
  <form>
    <input type="text" placeholder="titulo"/>
    <textarea placeholder="escreva sua nota..."/>
    <button>Criar Nota</button>
  </form>
  <ul>
    <li>
      <section>
        <header>
        <h3>Titulo</h3>
        </header>
        <p>Esreva sua nota</p>
      </section>
    </li>
  </ul>
  </section>
  );
}

export default App;
